from utils.bioutils import hamming_distance
from utils.pyutils import fst, snd


def get_hamming_distance_matcher(d):
    def matcher(text1, text2):
        return hamming_distance(text1, text2) <= d

    return matcher


def all_approximate_occurences(text, pattern, d):
    matcher = get_hamming_distance_matcher(d)
    pattern_length = len(pattern)
    kmers = [(i, text[i: i + pattern_length]) for i in range(len(text) - pattern_length + 1)]
    return map(fst, filter(lambda x: matcher(snd(x), pattern), kmers))


if __name__ == '__main__':
    TEXT = ''
    PATTERN = 'ATTTTGATGTT'
    d = 6
    print(' '.join(map(str, all_approximate_occurences(TEXT, PATTERN, d))))
